import React from "react";
import { Box, Button, Typography } from "@mui/material";

import HeroBannerImg from '../assets/images/herobanner.jpg'

const Herobanner = () => {
  return (
    <Box
      sx={{ mt: { lg: "212px", xs: "70px" }, ml: { sm: "1px" } }}
      position="relative"
      p="20px 10px" 
    >
    <img src={HeroBannerImg} 
      className="hero-banner-img"/>
      {/* <Typography color="#3572EF" fontWeight="500" fontSize="36px" mb={2}>
        Vayam - experience the fitness journey
      </Typography> */}
      <Typography position='absolute' top='-150px' left='100px' color='aqua' fontWeight={700} sx={{fontSize:{lg:'44px',xs:'40px'}}}>
        Workout, Swet & Repeat
      </Typography>
      <Typography position='absolute' left='700px' color='darkcyan' fontWeight='600' fontSize='22px' lineHeight='55px' mb={3}>
        Check out the most effective workouts
      </Typography>

      <Button variant="contained" color="success" href="#exercises" >
        explore
      </Button>

      

    </Box>
  );
};

export default Herobanner;
